package dto;

public class AccDTO {
	private int acc_num;
	private String acc_session;
	private String acc_ip;
	private String acc_uid;
	private String acc_time;
	
	public AccDTO() {
		// TODO Auto-generated constructor stub
	}

	public int getAcc_num() {
		return acc_num;
	}

	public void setAcc_num(int acc_num) {
		this.acc_num = acc_num;
	}

	public String getAcc_session() {
		return acc_session;
	}

	public void setAcc_session(String acc_session) {
		this.acc_session = acc_session;
	}

	public String getAcc_ip() {
		return acc_ip;
	}

	public void setAcc_ip(String acc_ip) {
		this.acc_ip = acc_ip;
	}

	public String getAcc_uid() {
		return acc_uid;
	}

	public void setAcc_uid(String acc_uid) {
		this.acc_uid = acc_uid;
	}

	public String getAcc_time() {
		return acc_time;
	}

	public void setAcc_time(String acc_time) {
		this.acc_time = acc_time;
	}
	
	
}
